import React ,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import {Navbar,Nav} from 'react-bootstrap';
import './register.css';
class Navi extends Component
{
    render(){
        return (
            <div >
                <div role="navigation" className="navbar navbar-expand-md navbar-light p-0">
                    <div role="navigation" className="navbar navbar-expand-md ml-auto">
                        <div id="navbarSupportedContent" className="collapse navbar-collapse navbar-container">
                            <ul className="nav navbar-right header-menu navmenu-nav ml-auto d-block">
                                <li className="user-signup"><a id="bdg-learn-button-header-signup"
                                                               href="https://www.bitdegree.org/register" target="_blank"
                                                               rel="noopener">Sign up Free</a></li>
                            </ul>
                        </div>
                    </div>
                </div>

            </div>
        );
    }
}



export default Navi;
